import React from 'react';

// == Import Style
import HeaderStyled from './HeaderStyled';

const Header = () => {
  let menuOpen = false;

  const handleClickMenu = () => {
    const menuList = document.querySelector('.openMenu');

    if(!menuOpen) {
      menuList.classList = ''
    }
  };

  return (
  <HeaderStyled>
    <div className="logo">
      <img src={process.env.PUBLIC_URL + '/img/grainDeVrac-logo-blanche-png.png'} alt=""/>
    </div>
    <div className="menu">
      <button className="buttonMenu" type="button" onClick={handleClickMenu}>
        <span className="squares-menu">
          <div className="square"></div>
          <div className="square"></div>
          <div className="square"></div>
          <div className="square"></div>
        </span>
      </button>
      <nav className="closedMenu">
        <ul>
          <li><a href="#">accueil</a></li>
          <li><a href="#">catalogue des produits</a></li>
          <li><a href="#">planning</a></li>
          <li><a href="#">qui sommes-nous ?</a></li>
          <li><a href="#">recettes</a></li>
          <li><a href="#">ma liste de courses</a></li>
          <li><a href="#">connexion</a></li>
        </ul>
      </nav>

    </div>
  </HeaderStyled>
  )
};

export default Header;
